import Vegan from '../assets/vegan.jpg';
import Expensive from '../assets/expensive.jpg';

export const MenuList = [
    {
        name: "Pepperoni Pizza",
        image: Pepperoni,
        price: 9.99
    },
    {
        name: "Margherita Pizza",
        image: Margherita,
        price: 12.99
    },
    {
        name: "Pineapple Pizza",
