    {
        name: "Sam's Specialty Pizza",
        image: SamSpecial,
        price: 29.99
    },
    {
        name: "Vegan Pizza",
        image: Vegan,
        price: 16.99
    },
    {
        name: "Very Expensive Pizza",
        image: Expensive,
        price: 59.99
    }
]
